INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 401, 0.0, 102301, "2030/12/17 14:59:59", 10046, "アヤネ", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 402, 0.0, 102301, "2030/12/17 14:59:59", 10046, "アヤネ", 24, 1, 2.21, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 403, 0.0, 102301, "2030/12/17 14:59:59", 10046, "アヤネ", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 701, 0.0, 192201, "2030/12/17 14:59:59", 10046, "アサヒ", 24, 2, 1.99, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 702, 0.0, 192201, "2030/12/17 14:59:59", 10046, "アサヒ", 24, 1, 2.21, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 703, 0.0, 192201, "2030/12/17 14:59:59", 10046, "アサヒ", 24, 2, 3.33, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 801, 0.0, 192301, "2030/12/17 14:59:59", 10046, "部員３", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 802, 0.0, 192301, "2030/12/17 14:59:59", 10046, "部員３", 24, 1, 2.68, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 803, 0.0, 192301, "2030/12/17 14:59:59", 10046, "部員３", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "やった！", 24010, 501, 0.0, 192501, "2030/12/17 14:59:59", 10046, "", 24, 1, 0.0, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "勝ったよ！", 24011, 502, 0.0, 192501, "2030/12/17 14:59:59", 10046, "", 24, 1, 0.0, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "いい調子！", 24012, 503, 0.0, 192501, "2030/12/17 14:59:59", 10046, "", 24, 1, 0.0, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 111, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 6, 5.33, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 112, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 1, 6.85, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 113, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 1, 3.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 611, 0.0, 192401, "2030/12/17 14:59:59", 10046, "ダイチ", 24, 1, 6.11, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 612, 0.0, 192401, "2030/12/17 14:59:59", 10046, "ダイチ", 24, 1, 6.75, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 613, 0.0, 192401, "2030/12/17 14:59:59", 10046, "ダイチ", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 211, 0.0, 113401, "2030/12/17 14:59:59", 10046, "ハツネ", 24, 2, 4.52, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 212, 0.0, 113401, "2030/12/17 14:59:59", 10046, "ハツネ", 24, 2, 3.89, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 213, 0.0, 113401, "2030/12/17 14:59:59", 10046, "ハツネ", 24, 1, 13.49, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 311, 0.0, 106501, "2030/12/17 14:59:59", 10046, "カヤ", 24, 1, 3.17, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 312, 0.0, 106501, "2030/12/17 14:59:59", 10046, "カヤ", 24, 1, 4.42, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 313, 0.0, 106501, "2030/12/17 14:59:59", 10046, "カヤ", 24, 6, 2.89, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 421, 0.0, 102301, "2030/12/17 14:59:59", 10046, "アヤネ", 24, 4, 3.71, 3);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 721, 0.0, 192201, "2030/12/17 14:59:59", 10046, "アサヒ", 24, 2, 5.1, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 821, 0.0, 192301, "2030/12/17 14:59:59", 10046, "部員３", 24, 1, 4.34, 3);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", 0.0, "いい勝負だったよ\nまたやろうね", 24028, 521, 0.0, 192501, "2030/12/17 14:59:59", 10046, "", 24, 1, 0.0, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 101, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 1, 5.62, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 102, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 1, 9.58, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 103, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 2, 0.0, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 104, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 2, 9.13, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES ("2020/07/31 12:00:00", -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 105, 0.0, 113501, "2030/12/17 14:59:59", 10046, "ミサト", 24, 1, 8.27, 2);
